import { StyleSheet, Text, View } from "react-native";
import React from "react";
import Background from "../Component/Background";

const CameraPage = () => {
  return (
    <View>
      <Background />
      <Text>CameraPage</Text>
    </View>
  );
};

const styles = StyleSheet.create({});

export default CameraPage;
